var minWindow = function (s, t) {
  let minWindow = Array(s.length + 1).fill();

  let tCharCount = {};
  for (let x of t) {
    if (x in tCharCount) tCharCount[x]++;
    else tCharCount[x] = 1;
  }
  let ssCharCount = {};
  for (let x in tCharCount) ssCharCount[x] = 0;

  const shiftWindow = (start, end) => {
    while (end < s.length) {
      if (s[end] in tCharCount) {
        ssCharCount[s[end]]++;
        if (ssCharCount[s[end]] === tCharCount[s[end]])
          if (checkSubstring(ssCharCount)) break;
      }
      end++;
    }
    while (start <= end) {
      if (s[start] in tCharCount) {
        if (ssCharCount[s[start]] === tCharCount[s[start]]) break;
        ssCharCount[s[start]]--;
      }
      start++;
    }
    if (checkSubstring(ssCharCount) && end - start + 1 < minWindow.length)
      minWindow = s.slice(start, end + 1);
    if (end < s.length) {
      if (s[start] in tCharCount) ssCharCount[s[start]]--;
      shiftWindow(start + 1, end + 1);
    }
  };

  const checkSubstring = (ssCharCount) => {
    for (let x in tCharCount) {
      if (ssCharCount[x] < tCharCount[x]) return false;
    }
    return true;
  };

  shiftWindow(0, 0);
  if (!minWindow[0]) return "";
  return minWindow;
};

